.btn {
  position: relative;
  display: inline-block;
  white-space: nowrap;
  text-align: center;
  border-style: solid;
  outline: 0;
  margin: 0;
  user-select: none;
  -webkit-user-select: none;
  -ms-user-select: none;
  -moz-user-select: none;
}
.transparent {
  color:#fff;
  font-size: 16px;
  background: transparent;
  border: none;
  outline: none;
  cursor: pointer;
}
.transparent:hover {
  background-color: rgba(255,255,255,0.2);
}
.transparent:active {
  background-color:rgba(0,0,0,0.2);
}
.disabled {
  position: absolute;
  width: 100%;
  height: 100%;
  left: 0;
  top: 0;
  background-color: rgba(235, 235, 235, 0.6);
  opacity: 0.6;
  filter: alpha(opacity=60); 
  cursor: not-allowed;
}
